	@Inject
	public ScaleGrammarAccess(GrammarProvider grammarProvider,
			XbaseGrammarAccess gaXbase,
			XtypeGrammarAccess gaXtype) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaXbase = gaXbase;
		this.gaXtype = gaXtype;
		this.pScale = new ScaleElements();
		this.pInfrastructure = new InfrastructureElements();
		this.tINFRASTRUCTURE_TYPE = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "uk.ac.kcl.inf.mdeoptimiser.languages.Scale.INFRASTRUCTURE_TYPE");
		this.pExperiment = new ExperimentElements();
		this.pModel = new ModelElements();
		this.pTask = new TaskElements();
		this.pRunConfiguration = new RunConfigurationElements();
		this.pDependency = new DependencyElements();
		this.pParameter = new ParameterElements();
		this.pParameterValue = new ParameterValueElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("uk.ac.kcl.inf.mdeoptimiser.languages.Scale".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
